import numpy as np
m = 100000001
mat = [[0] * 5 for _ in range(5)]
mat[0] = [6, 2, 4, 2, 1]
for i in range(1, 5):
    mat[i][i - 1] = 1

def mul(A, B):
    C = [[0] * 5 for _ in range(5)]
    for i in range(5):
        for j in range(5):
            for k in range(5):
                C[i][j] = (C[i][j] + A[i][k] * B[k][j]) % m
    return C

def pow_(A, n):
    if n == 1:
        return A
    T = pow_(A, n // 2)
    if n % 2 == 0:
        return mul(T, T)
    return mul(mul(T, T), A)

def entrance(n):
    if n < 5:
        return [1, 2, 4, 8, 16][n]
    else:
        return pow_(mat, n - 4)[0][0]

